import React, { Fragment } from "react";
import { Card, Row, Col, Divider, Statistic } from "antd";
const { Countdown } = Statistic;
const deadline = Date.now() + 1000 * 60 * 60 * 12;

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(reserv => (
          <Col key={reserv.id}>
            <Card
              key={reserv.id}
              style={{ width: "400px" }}
              className="border border-warning rounded m-2"
              title={
                <h4 className="text-center bg-light text-dark border border-dark rounded">{`Table: ${reserv.table_number}`}</h4>
              }
              cover={
                <h4 className="text-info  text-center mt-4">
                  {reserv.customer_name}
                </h4>
              }
            >
              <Divider />
              <Card.Meta
                title={<h4 className="text-dark">{`Seats:${reserv.seats}`}</h4>}
                description={
                  <Countdown
                    title="Million Seconds"
                    value={deadline}
                    // format="HH:mm:ss:SSS"
                  />
                }
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
